import React from "react";
import { Button, Container, Image } from "react-bootstrap";
import browser from "../../images/application-icon.png";

const About = () => {
  return (
    <Container>
      <h1>A little bit about me...</h1>
      <Image src={browser} />
      <Image
        src={
          "https://media2.giphy.com/media/xT9IgzoKnwFNmISR8I/giphy.gif?cid=ecf05e47xylw6v0j2uw1z84ii55b849i1bne45tuh7nnbrr4&rid=giphy.gif&ct=g"
        }
      />
      <Button variant="primary">Primary</Button>
      <Button variant="outline-primary">Primary</Button>{" "}
    </Container>
  );
};

export default About;
